import React from "react";

export default function Navbar() {
  return (
    <header>
      <div>
        <div>
          <i className="fa-brands fa-reddit" color="orange">
            Reddit
          </i>
        </div>
        <div>
          <button>Log In</button>
          <i class="fa-regular fa-user"></i>
        </div>
      </div>
    </header>
  );
}
